import props from "../data/data"
import RealEstat from "./real-estat"
const Home = () => (
    props.map(item=>{
        return(
            <div className="proportes">
        <RealEstat key={item.id} item={item}></RealEstat>
            <style jsx>{`
                
                .proportes{
                    display: flex;
                    flex-direction: row;
                    flex-wrap: wrap;
                    justify-content: space-around;
                    max-height: 70vh;
                    overflow-y: scroll;
                }
                
                ` }
                
            </style>

           </div>
            )
    })
)

   
  export default Home;
